// import logo from './logo.svg';
// import './App.css';

function App() {
  return (
    <>
      <article>
        <html>
          <body>
            <h1>Resume</h1>
          <p>รายงานประวัติส่วนตัว</p>
          <ul>
            <li>ภาณุเดช แสงวิเศษ</li>
            <li>การาวิน ยินดี</li>
            <li>จีรายุ แสงอาวุธ</li>
          </ul>
          </body>

        </html>

      </article>

    </>

  );
}

export default App;
